import React, { useState, useEffect } from 'react';
import { FiTarget, FiAward, FiRefreshCw, FiHeart } from 'react-icons/fi';

const WellnessGame = ({ isOpen, onClose }) => {
    const [currentGame, setCurrentGame] = useState('breathing');
    const [score, setScore] = useState(0);
    const [breathingCount, setBreathingCount] = useState(0);
    const [isBreathing, setIsBreathing] = useState(false);
    const [gameCompleted, setGameCompleted] = useState(false);

    const games = [
        {
            id: 'breathing',
            title: 'Mindful Breathing',
            description: 'Take deep breaths to calm your mind before making a purchase',
            icon: 'ü´Å',
            instructions: 'Click "Start" and breathe in for 4 seconds, hold for 4, exhale for 4'
        },
        {
            id: 'reflection',
            title: 'Purchase Reflection',
            description: 'Reflect on your spending habits and emotional triggers',
            icon: 'üí≠',
            instructions: 'Answer questions about your spending patterns'
        },
        {
            id: 'gratitude',
            title: 'Gratitude Practice',
            description: 'Focus on what you already have instead of what you want to buy',
            icon: 'üôè',
            instructions: 'List 3 things you\'re grateful for today'
        }
    ];

    const currentGameData = games.find(game => game.id === currentGame);

    const startBreathingExercise = () => {
        setIsBreathing(true);
        setBreathingCount(0);

        const breathingInterval = setInterval(() => {
            setBreathingCount(prev => {
                if (prev >= 5) {
                    clearInterval(breathingInterval);
                    setIsBreathing(false);
                    setScore(prev => prev + 10);
                    setGameCompleted(true);
                    return 0;
                }
                return prev + 1;
            });
        }, 4000); // 4 seconds per breath cycle
    };

    const resetGame = () => {
        setScore(0);
        setBreathingCount(0);
        setIsBreathing(false);
        setGameCompleted(false);
    };

    const nextGame = () => {
        const currentIndex = games.findIndex(game => game.id === currentGame);
        const nextIndex = (currentIndex + 1) % games.length;
        setCurrentGame(games[nextIndex].id);
        setGameCompleted(false);
    };

    if (!isOpen) return null;

    return (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
            <div className="bg-white rounded-lg p-6 max-w-md w-full mx-4 max-h-[90vh] overflow-y-auto">
                <div className="flex justify-between items-center mb-4">
                    <h2 className="text-xl font-semibold text-gray-900 flex items-center">
                        <FiHeart className="mr-2 text-red-500" />
                        Wellness Game
                    </h2>
                    <button
                        onClick={onClose}
                        className="text-gray-400 hover:text-gray-600"
                    >
                        ‚úï
                    </button>
                </div>

                {/* Score Display */}
                <div className="bg-blue-50 p-3 rounded-lg mb-4">
                    <div className="flex items-center justify-between">
                        <span className="text-sm text-blue-700">Wellness Score</span>
                        <span className="text-lg font-bold text-blue-800">{score}</span>
                    </div>
                </div>

                {/* Game Selection */}
                <div className="mb-4">
                    <div className="flex gap-2 mb-3">
                        {games.map((game) => (
                            <button
                                key={game.id}
                                onClick={() => setCurrentGame(game.id)}
                                className={`px-3 py-1 rounded-full text-sm font-medium transition-colors ${currentGame === game.id
                                        ? 'bg-blue-600 text-white'
                                        : 'bg-gray-100 text-gray-700 hover:bg-gray-200'
                                    }`}
                            >
                                {game.icon}
                            </button>
                        ))}
                    </div>
                </div>

                {/* Current Game */}
                <div className="text-center mb-6">
                    <div className="text-4xl mb-2">{currentGameData.icon}</div>
                    <h3 className="text-lg font-semibold text-gray-900 mb-2">
                        {currentGameData.title}
                    </h3>
                    <p className="text-sm text-gray-600 mb-4">
                        {currentGameData.description}
                    </p>
                    <p className="text-xs text-gray-500 bg-gray-50 p-2 rounded">
                        {currentGameData.instructions}
                    </p>
                </div>

                {/* Game Content */}
                {currentGame === 'breathing' && (
                    <div className="text-center">
                        {!isBreathing && !gameCompleted && (
                            <button
                                onClick={startBreathingExercise}
                                className="btn btn-primary w-full"
                            >
                                <FiTarget className="mr-2" />
                                Start Breathing Exercise
                            </button>
                        )}

                        {isBreathing && (
                            <div className="space-y-4">
                                <div className="text-6xl animate-pulse">
                                    {breathingCount % 2 === 0 ? 'ü´Å' : 'üí®'}
                                </div>
                                <p className="text-lg font-medium">
                                    {breathingCount % 2 === 0 ? 'Breathe In...' : 'Breathe Out...'}
                                </p>
                                <p className="text-sm text-gray-600">
                                    Breath {Math.floor(breathingCount / 2) + 1} of 5
                                </p>
                            </div>
                        )}

                        {gameCompleted && (
                            <div className="space-y-4">
                                <div className="text-6xl">üéâ</div>
                                <p className="text-lg font-medium text-green-600">
                                    Great job! You've completed the breathing exercise.
                                </p>
                                <p className="text-sm text-gray-600">
                                    You earned 10 wellness points!
                                </p>
                            </div>
                        )}
                    </div>
                )}

                {currentGame === 'reflection' && (
                    <div className="space-y-4">
                        <div className="bg-yellow-50 p-4 rounded-lg">
                            <h4 className="font-medium text-yellow-800 mb-2">
                                Reflection Questions:
                            </h4>
                            <ul className="text-sm text-yellow-700 space-y-2">
                                <li>‚Ä¢ What emotions do you feel before making a purchase?</li>
                                <li>‚Ä¢ Do you often buy things when stressed or sad?</li>
                                <li>‚Ä¢ What alternatives could you try instead of shopping?</li>
                            </ul>
                        </div>
                        <button
                            onClick={() => {
                                setScore(prev => prev + 15);
                                setGameCompleted(true);
                            }}
                            className="btn btn-primary w-full"
                        >
                            Complete Reflection
                        </button>
                    </div>
                )}

                {currentGame === 'gratitude' && (
                    <div className="space-y-4">
                        <div className="bg-green-50 p-4 rounded-lg">
                            <h4 className="font-medium text-green-800 mb-2">
                                Gratitude Practice:
                            </h4>
                            <p className="text-sm text-green-700 mb-3">
                                Take a moment to appreciate what you already have:
                            </p>
                            <div className="space-y-2">
                                {[1, 2, 3].map((num) => (
                                    <div key={num} className="flex items-center">
                                        <span className="text-green-600 mr-2">‚Ä¢</span>
                                        <input
                                            type="text"
                                            placeholder={`I'm grateful for...`}
                                            className="flex-1 text-sm p-2 border border-green-200 rounded"
                                        />
                                    </div>
                                ))}
                            </div>
                        </div>
                        <button
                            onClick={() => {
                                setScore(prev => prev + 20);
                                setGameCompleted(true);
                            }}
                            className="btn btn-primary w-full"
                        >
                            Complete Gratitude
                        </button>
                    </div>
                )}

                {/* Game Actions */}
                {gameCompleted && (
                    <div className="flex gap-2 mt-6">
                        <button
                            onClick={nextGame}
                            className="btn btn-outline flex-1"
                        >
                            <FiRefreshCw className="mr-2" />
                            Next Game
                        </button>
                        <button
                            onClick={resetGame}
                            className="btn btn-outline flex-1"
                        >
                            <FiAward className="mr-2" />
                            Reset Score
                        </button>
                    </div>
                )}

                {/* Wellness Tip */}
                <div className="mt-6 p-3 bg-blue-50 rounded-lg">
